class Solution:
    def maxOperations(self, s: str) -> int:
        res=0
        count1=0
        n=len(s)
        for i in range(n-1):
            if s[i]=='1':
                count1+=1            
                if s[i+1]=='0':#s[i]=='1' and s[i+1]=='0'
                    res+=count1
        return res
